import React from 'react';

function List() {
  const reviewers = ['reviewer1', 'reviewer2'];
  const reviews = ['This is good', 'This is very good'];

  return (
    <div>
      {reviewers.map((r, index) => (
        <ul key={index}>
          <li>{r} &nb {reviews[index]}</li>
        </ul>
      ))}
    </div>
  );
}

export default List;
